package com.gitile.fast.core.mybatis;

import com.baomidou.mybatisplus.annotation.DbType;
import com.baomidou.mybatisplus.annotation.IdType;
import com.baomidou.mybatisplus.generator.AutoGenerator;
import com.baomidou.mybatisplus.generator.config.DataSourceConfig;
import com.baomidou.mybatisplus.generator.config.GlobalConfig;
import com.baomidou.mybatisplus.generator.config.PackageConfig;
import com.baomidou.mybatisplus.generator.config.StrategyConfig;
import com.baomidou.mybatisplus.generator.config.converts.MySqlTypeConvert;
import com.baomidou.mybatisplus.generator.config.querys.MySqlQuery;
import com.baomidou.mybatisplus.generator.config.rules.DateType;
import com.baomidou.mybatisplus.generator.config.rules.NamingStrategy;
import com.baomidou.mybatisplus.generator.keywords.MySqlKeyWordsHandler;
import com.gitile.fast.core.utils.FilenameUtils;

/**
 * 代码生成工具类
 */
public class FastCodeGenerator {

	/**
	 * 构造方法
	 */
	private FastCodeGenerator() {
		throw new IllegalStateException("Utility class");
	}

	/**
	 * 使用mybatisplus的AutoGenerator进行model、dao、mapper的生成
	 */
	public static void autoPersistenceMysql(String basePakcage, String author, DataSourceConfig.Builder dscBuilder) {
		// Build DataSourceConfig
		DataSourceConfig dataSourceConfig = dscBuilder
				.dbQuery(new MySqlQuery())
				.typeConvert(new MySqlTypeConvert())
				.keyWordsHandler(new MySqlKeyWordsHandler())
				.build();

		// 全局配置
		GlobalConfig globalConfig = new GlobalConfig.Builder()
				.outputDir(getMavenJavaPath()) // 这里写你自己的java目录
				.author(author)
				.disableOpenDir() // 禁止打开输出目录
				.dateType(DateType.ONLY_DATE)
				.build();

		// 包配置
		PackageConfig packageConfig = new PackageConfig.Builder()
				.parent(basePakcage)
				.build();

		// 策略配置
		StrategyConfig strategyConfig = new StrategyConfig.Builder()
				.enableCapitalMode() // 开启大写命名
				.enableSkipView() // 开启跳过视图
				.entityBuilder()
				.enableLombok() // 启用lombok
				.enableTableFieldAnnotation() // 启用字段注解
				.idType(IdType.AUTO) // 主键策略
				.naming(NamingStrategy.underline_to_camel) // 数据库表映射到实体的命名策略
				.columnNaming(NamingStrategy.underline_to_camel) // 数据库表字段映射到实体的命名策略
				.build()
				.controllerBuilder()
				.enableRestStyle() // 开启生成@RestController控制器
				.build()
				.mapperBuilder()
				.enableBaseResultMap() // 启用BaseResultMap生成
				.build()
				.build();

		// 代码生成器
		AutoGenerator mpg = new AutoGenerator(dataSourceConfig);
		mpg.global(globalConfig);
		mpg.packageInfo(packageConfig);
		mpg.strategy(strategyConfig);

		// 执行生成
		mpg.execute();
	}

	public static String getMavenJavaPath() {
		return System.getProperty("user.dir") + FilenameUtils.separatorsToSystem("\\src\\main\\java\\");
	}

}

